import React, { useState } from 'react'
import './imageslider.css'

export default function ImageSlider() {

    const imageBox = [{
            id: 0,
            image: "https://images.unsplash.com/photo-1615327631885-bca9e5798b16?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1287&q=80",
        },
        {
            id: 1,
        }
    ]

    const [currentImage, setCurrentImage] = useState()

    return (
        <div>
            <div>
                {
                    <img className="w-screen h-24" src={imageBox[0].image} />
                }
            </div>
        </div>
    )
}
